import HEAD from 'next/head'
import Navbar from "./Navbar";

const Layout = (props) => (
    <div>
        <HEAD>
            <title>BitzPrice</title>
        </HEAD>
        <Navbar/>
        {props.children}
    </div>
);

export default Layout;
